import React, { Component } from 'react';
import './App.css';

let defaulttextColor = '#fff';
let defaultStyle = {
  color: defaulttextColor

}


class Filter extends Component {
  render() {
    return (
      <div style={{defaultStyle}}>
        <img />
        <input type="text" />
      </div>
    )
  }
}

class Playlist extends Component {
  render() {
    return (
      <div style={{...defaultStyle, width: '25%' }}>
        <img />
        <h3>Playlist Name</h3>
        <ul>
          <li>
            Song 1
            </li>
          <li>
            Song 2
            </li>
          <li>
            Song 3
            </li>
        </ul>
      </div>
    )
  }
}

class Aggregate extends Component {
  render() {
    return (
      <div style={{ defaultStyle,  width: '40%', color: '#ccc', display: "inline-block" }}>
        <h2>
          Number Text
        </h2>
      </div>
    )
  }
}
function App() {
  return (
    <div className="App">
      <h1 style={{ color: '#fff' }}>Title</h1>
      <Aggregate />
      <Aggregate />
      <Filter />
      <Playlist />
      <Playlist />
      <Playlist />
      <Playlist />
    </div>
  );
}

export default App;
